def calc(res, t):
    if res[0] == '+':
        res = res[1:]
    elif res[-1] == '+':
        res = res[:-1]        

    # inverse?
    res = res.replace('!', '-')

    if t == 'p':
        ls = [int(item) for item in res.split('+')]
        return(str(sum(ls)))
    elif t == 'b':
        # also summing for now
        ls = [int(item) for item in res.split('+')]
        return(str(reduce(operator.mul, ls, 1)))
    
    
    
